import React, { useState, useCallback } from 'react';
import { UploadCloud, FileText, BrainCircuit, AlertTriangle, CheckCircle, Loader } from 'lucide-react';

// Main application component
function App() {
  const [selectedFile, setSelectedFile] = useState(null);
  const [analysisResult, setAnalysisResult] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);
  const [isDragOver, setIsDragOver] = useState(false);

  // Handles the file selection from the file input
  const handleFileChange = (event) => {
    setSelectedFile(event.target.files[0]);
  };

  // Handles form submission to analyze the log file
  const handleAnalyze = async () => {
    if (!selectedFile) {
      setError('Please select a file first.');
      return;
    }

    setIsLoading(true);
    setError(null);
    setAnalysisResult(null);

    // We use FormData to send the file to the backend
    const formData = new FormData();
    formData.append('log_file', selectedFile);

    try {
      // API call to the backend
      const response = await fetch('[http://127.0.0.1:8000/analyze/](http://127.0.0.1:8000/analyze/)', {
        method: 'POST',
        body: formData,
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data = await response.json();
      setAnalysisResult(data);

    } catch (e) {
      console.error("Error uploading file:", e);
      setError('Failed to analyze the file. Please ensure the backend server is running.');
      setAnalysisResult(null);
    } finally {
      setIsLoading(false);
    }
  };

  // Handlers for drag and drop functionality
  const handleDragEnter = useCallback((e) => {
    e.preventDefault();
    e.stopPropagation();
    setIsDragOver(true);
  }, []);

  const handleDragLeave = useCallback((e) => {
    e.preventDefault();
    e.stopPropagation();
    setIsDragOver(false);
  }, []);

  const handleDragOver = useCallback((e) => {
    e.preventDefault();
    e.stopPropagation();
  }, []);

  const handleDrop = useCallback((e) => {
    e.preventDefault();
    e.stopPropagation();
    setIsDragOver(false);
    if (e.dataTransfer.files && e.dataTransfer.files.length > 0) {
      setSelectedFile(e.dataTransfer.files[0]);
      e.dataTransfer.clearData();
    }
  }, []);


  return (
    <div className="bg-slate-900 min-h-screen flex flex-col items-center justify-center font-sans text-white p-4">
      <div className="w-full max-w-4xl">
        {/* Header Section */}
        <header className="text-center mb-8">
          <div className="flex items-center justify-center gap-4 mb-2">
            <BrainCircuit className="h-12 w-12 text-cyan-400" />
            <h1 className="text-5xl font-bold tracking-tight">AI Incident Analyst</h1>
          </div>
          <p className="text-slate-400 text-lg">
            Upload logs or MTR output to get instant analysis and resolution steps.
          </p>
        </header>

        <main className="bg-slate-800/50 rounded-2xl shadow-2xl shadow-cyan-500/10 p-8 border border-slate-700">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-8">

            {/* Left Side: File Upload */}
            <div className="flex flex-col">
              <h2 className="text-2xl font-semibold mb-4 flex items-center gap-2">
                <UploadCloud className="text-cyan-400" />
                1. Upload Log File
              </h2>

              <div 
                className={`flex-grow flex flex-col items-center justify-center border-2 border-dashed rounded-lg p-6 transition-colors duration-300 ${isDragOver ? 'border-cyan-400 bg-slate-700/50' : 'border-slate-600 hover:border-cyan-500'}`}
                onDragEnter={handleDragEnter}
                onDragLeave={handleDragLeave}
                onDragOver={handleDragOver}
                onDrop={handleDrop}
              >
                <input
                  type="file"
                  id="file-upload"
                  className="hidden"
                  onChange={handleFileChange}
                />
                 <label htmlFor="file-upload" className="text-center cursor-pointer">
                    <UploadCloud className="mx-auto h-12 w-12 text-slate-400 mb-2" />
                    <span className="font-semibold text-cyan-400">Click to upload</span>
                    <span className="text-slate-400"> or drag and drop</span>
                    <p className="text-xs text-slate-500 mt-1">Syslog, Journalctl, MTR, etc.</p>
                </label>
              </div>

              {selectedFile && (
                <div className="mt-4 p-3 bg-slate-700 rounded-lg flex items-center justify-between">
                  <div className="flex items-center gap-2">
                    <FileText className="h-5 w-5 text-slate-400" />
                    <span className="text-sm font-mono">{selectedFile.name}</span>
                  </div>
                  <button onClick={() => setSelectedFile(null)} className="text-slate-400 hover:text-white">&times;</button>
                </div>
              )}

              <button
                onClick={handleAnalyze}
                disabled={!selectedFile || isLoading}
                className="mt-6 w-full bg-cyan-500 hover:bg-cyan-600 disabled:bg-slate-600 disabled:cursor-not-allowed text-white font-bold py-3 px-4 rounded-lg flex items-center justify-center gap-2 transition-all duration-300 transform hover:scale-105"
              >
                {isLoading ? (
                  <>
                    <Loader className="animate-spin h-5 w-5" />
                    <span>Analyzing...</span>
                  </>
                ) : (
                  <>
                    <BrainCircuit className="h-5 w-5" />
                    <span>Analyze Now</span>
                  </>
                )}
              </button>
            </div>

            {/* Right Side: Analysis Result */}
            <div className="flex flex-col">
              <h2 className="text-2xl font-semibold mb-4">2. Get Analysis</h2>
              <div className="bg-slate-900/70 rounded-lg p-6 flex-grow border border-slate-700">
                {error && <StatusCard type="error" message={error} />}
                {isLoading && <StatusCard type="loading" message="Processing file and consulting AI knowledge base..." />}
                {analysisResult && <StatusCard type="success" data={analysisResult} />}
                {!isLoading && !analysisResult && !error && (
                   <div className="text-center text-slate-500 h-full flex flex-col justify-center items-center">
                      <BrainCircuit size={48} className="mb-4 opacity-30"/>
                      <p>Analysis results will appear here.</p>
                   </div>
                )}
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
}

// A component to display status messages (error, loading, success)
const StatusCard = ({ type, message, data }) => {
  if (type === 'error') {
    return (
      <div className="bg-red-500/10 border border-red-500/30 text-red-300 p-4 rounded-lg flex items-center gap-3">
        <AlertTriangle />
        <div>
          <p className="font-semibold">Analysis Failed</p>
          <p className="text-sm">{message}</p>
        </div>
      </div>
    );
  }

  if (type === 'loading') {
    return (
      <div className="text-center text-slate-400 h-full flex flex-col justify-center items-center animate-pulse">
          <Loader size={48} className="mb-4 opacity-50 animate-spin"/>
          <p>{message}</p>
       </div>
    );
  }

  if (type === 'success' && data) {
    return (
      <div className="bg-green-500/10 border border-green-500/30 text-green-300 p-4 rounded-lg flex items-start gap-3">
        <CheckCircle className="flex-shrink-0 mt-1"/>
        <div>
          <p className="font-semibold mb-2">Analysis Complete!</p>
          <div className="text-sm text-slate-300 bg-slate-800 p-3 rounded-md">
            <p><strong className="text-slate-100">File Received:</strong> {data.filename}</p>
            <p><strong className="text-slate-100">File Size:</strong> {data.size_kb.toFixed(2)} KB</p>
            <p className="mt-2 italic text-slate-400">{data.message}</p>
          </div>
        </div>
      </div>
    );
  }

  return null;
};
